export const BOARD_INFO: string =
  '<div class="ql-editor pt-4 pl-0 pr-0 pb-0 overflow-hidden"><h2><strong style="background-color: transparent; color: rgb(0, 0, 0);">팜피는 나에게 새로운 성장이다.</strong></h2><p><span style="background-color: transparent; color: rgb(67, 67, 67);">개발팀 | 이기완 학생(@Wan.mate)</span></p><p><img src="data:image/jpeg;base64,"></p><p><strong style="background-color: transparent; color: rgb(67, 67, 67);">Editor’s note</strong></p><blockquote><span style="background-color: transparent; color: rgb(67, 67, 67);">인턴 중 최장시간 인터뷰에 응해주셨던 완메이트는 그만큼 꼼꼼하고 완벽을 기하는 성격을 가졌다는 걸 알 수 있었는데요. 진로에 대한 진지한 고민과 개발에 대한 열정이 느껴지는 완메이트의 성장의 과정을 들어봅니다.</span></blockquote><h3><br></h3><h3><strong style="background-color: transparent; color: rgb(0, 0, 0);">Chapter 1. 직무 소개</strong></h3><p><strong style="background-color: transparent; color: rgb(0, 0, 0);">Q. 안녕하세요! 간단하게 자기소개 부탁드려요.</strong></p><p><span style="background-color: transparent; color: rgb(0, 0, 0);">저는 9월부터 팜피의 개발자 인턴으로 들어온 이기완, 완메이트입니다.</span></p><p><br></p><p><strong style="background-color: transparent; color: rgb(0, 0, 0);">Q. 현재 직무에 대한 공부는 언제부터 하셨나요?</strong></p><p><span style="background-color: transparent; color: rgb(0, 0, 0);">전공이 컴퓨터공학과인데 사실 고등학교에서 대학교로 넘어갈 때 성적에 맞는 과를 선택해서 들어갔던 거였기 때문에 크게 흥미가 없었습니다. 솔직히 컴퓨터에 그렇게 관심도 없었고 타자도 되게 느린 편이었고요.(교수님이 화면에 띄워두신 수업 자료를 받아 적다가 페이지 넘어가기 전에 다 못 쳤답니다.)</span></p><p><br></p><p><strong style="background-color: transparent; color: rgb(0, 0, 0);">Q. 진로 탐색 중 어떤 점 때문에 관심을 가지고 선택하게 되셨는지 궁금해요!</strong></p><p><span style="background-color: transparent; color: rgb(0, 0, 0);">코딩을 되게 힘들어 했었어서 군대 갔을 때까지도 자퇴 고민을 했었어요. 학과랑 너무 안 맞는다는 생각이 들었고 전역을 하고 나서 친구가 ‘졸업하고 취업할 생각인데 코딩 스터디를 하자’고 해서 들어갔어요. 학교가 아닌 밖에서 코딩을 하니까 문제를 하나하나 푸는 게 수학 문제를 푸는 듯한 쾌감을 주면서 되게 재밌더라고요. 그때부터 코딩이라는 건 주어진 문제를 해결하기 위한 과정이겠구나 생각했고, 그러면 수학적인 거나 퍼즐 같은 걸 좋아하는 저에게 되게 잘 맞겠다는 생각이 그때부터 들더라고요. 그때부터 되게 재미있게 했습니다.&nbsp;</span></p><p><br></p><p><strong style="background-color: transparent; color: rgb(0, 0, 0);">Q. 학교에서 진행한 프로젝트와 실무에서 경험한 프로젝트는 어떤 점이 가장 다르다고 느꼈나요?</strong></p><p><span style="background-color: transparent; color: rgb(0, 0, 0);">셀 수 없이 굉장히 많은 것들이 처음부터 끝까지 다 다르다고 생각이 드는데, 비유를 하자면 소꿉장난과 식당에서 손님을 위한 요리를 하는 것 정도의 큰 차이라고 생각을 합니다. 그 중에 가장 큰 차이를 느꼈던 건 완성도라고 생각이 듭니다. 기존에 친구들과 혹은 다른 동료들과 프로젝트를 진행할 때는 할 때는 ‘이 정도면 되지 않겠어?’ 하고 넘어갔고, 코드도 굉장히 지저분했지만 작동만 가능하면 된다고 생각하며 만들었던 코드가 많았어요. 하지만 실무에서는 잠깐 만들고 끝나는 게 아니라 2차, 3차의 또 다른 사용자가 생기기 때문에 코딩을 하면서 더 완성도 있게 만들어야 되더라고요. 솔직히 습관처럼 간과했던 에러가 예전에는 문제 될 게 없었는데 실무에선 그 작은 에러가 나중에 크게 불러올 수 있다는 걸 많이 느끼게 되었고 이런 완성도 측면에서 되게 다르다고 느꼈던 것 같습니다.</span></p><p><br></p><h3><strong style="background-color: transparent; color: rgb(0, 0, 0);">Chapter 2. 기업 선택</strong></h3><p><strong style="background-color: transparent; color: rgb(0, 0, 0);">Q. 어떻게 팜피를 찾아오셨나요?</strong></p><p><span style="background-color: transparent; color: rgb(0, 0, 0);">인턴십 공고에 팜피가 제공했던 기업 상세 내역을 봤는데 각 주차별로 계획도 되게 꼼꼼히 적혀 있었고, 그리고 인턴의 학습에 굉장히 많이 도움을 주실 만한 그런 요소가 많았던 게 멘토를 직접 붙여준다는 이렇게 이야기도 있었습니다. 또 다른 이유로는 귀여운 꼬디(팜피의 마스코트)가 사진으로 있던 게 가장 크기도 했었는데 그 무엇보다 많은 걸 배울 수 있겠다. 좋은 사람과 일할 수 있겠다라는 생각이 있었는데 그 생각은 지금도 변함없이 되게 잘 느끼고 있는 것 같습니다.</span></p><p><br></p><p><strong style="background-color: transparent; color: rgb(0, 0, 0);">Q. 인턴을 도전하게 된 이유가 궁금해요!</strong></p><p><span style="background-color: transparent; color: rgb(0, 0, 0);">일단 팜피를 들어오기 전에 4학년 1학기를 마치고 2학기는 무조건 인턴십을 하고 싶다는 생각을 올해 처음부터 계속 갖고 있었습니다. 그리고 어떻게 보면 아르바이트가 아닌 이제 실제 현장에서 일을 하는 첫 사회생활을 가능하면 좋은 분들과 많은 걸 배울 수 있는 공간에서 하고 싶다는 생각이 들었습니다.</span></p><p><br></p><p><strong style="background-color: transparent; color: rgb(0, 0, 0);">Q. 팜피에서 맡으신 업무는 뭐였는지 간단하게 소개해 주실 수 있나요?</strong></p><p><span style="background-color: transparent; color: rgb(0, 0, 0);">최근까지는 태안 관광 사업 중 하나였던 와볼태안 프로젝트에 참여하여 태안 쪽에서 사용하게 될 지도 맛집이나 관광지를 소개해주고 직접 누구가 등록을 하고 찾아갈 수 있게 만들어주는 앱 겸 웹 프로젝트를 진행을 했습니다. 프로젝트를 설계하는 것부터 시작해서 데이터도 설계하고 데이터 테이블 같은 것도 만들었고 이후에 백엔드 쪽에서 서버도 만들어보기도 했고 만들어진 서버 API를 가지고 화면을 만들어보는 단계도 진행했습니다.</span></p><p><span style="background-color: transparent; color: rgb(0, 0, 0);">제일 잘 맞았던 거는 역시 오기 전부터 가장 많이 공부를 하고 프로젝트에서 담당을 했었던 프론트 쪽 화면을 구성하는 일이 제일 잘 맞았던 것 같습니다.</span></p><p><br></p><p><strong style="background-color: transparent; color: rgb(0, 0, 0);">Q. 팜피 면접 꿀팁이 있을까요?</strong></p><p><span style="background-color: transparent; color: rgb(0, 0, 0);">어려운 질문이네요. 제가 수시로 팜피를 면접을 보고 자주 합격했던 게 아니고 한 번 도전해서 한 번 합격했던건데..</span></p><p><span style="background-color: transparent; color: rgb(0, 0, 0);">저는 일단 꿀팁이라고 얘기하기엔 정말 부끄럽긴 하지만 저랑 같이 면접을 봤던 분이 대외 활동도 많이 하시고 말씀도 되게 잘하시는 분이었습니다. 그래서 그 분이랑 같이 면접을 진행하는 과정에서 ‘이런 사람이 인턴이 돼야 되는구나’라는 게 느껴져서 저는 상대적으로 좀 부족한 사람이 아닐까 해서 그때부터 조금 즐기면서 어떻게 보면 되게 좋았던 부분으로 ‘후회 없이 내가 할 수 있는 말을 전부 다 해보자라’고 마음 먹고 그때부터 긴장을 안 하고 제가 했던 얘기를 다 할 수 있었던 것 같습니다. 나중에 그 분은 떨어지고 저는 붙었던 걸 생각해 보면 아마 그분이 갖고 있었던 기술 스택과 팜피에서 갖고 있던 기술 스택이 달랐던 점과 제가 좀 더 긴장하지 않고 말을 하면서 팜피의 분위기에 잘 녹아들 수 있겠다는 어필을 많이 했기 때문이 아닐까 싶습니다.</span></p><p><br></p><h3><strong style="background-color: transparent; color: rgb(0, 0, 0);">Chapter 3. 참여 후기</strong></h3><p><strong style="background-color: transparent; color: rgb(0, 0, 0);">Q. 팜피만의 문화 중 인상깊었던 것은 뭐였나요?</strong></p><p><span style="background-color: transparent; color: rgb(0, 0, 0);">가장 먼저 머릿속에 기억나는 거 회식 자체를 이제 업무 시간 내라고 볼 수 있는 시간에 했던 게 좀 그런 문화 의식이라고 지 제가 생각했던 이 드라마나 영화나 이제 조금 가끔만 해도 웹툰이나 이런 데서 봤던 회식 분위기는 이제 일 끝나고 부장님이 다들 끝나고 뭐 소주한잔 해야지 약간 이런 분위기를 너무 많이 봤고 그냥 어떤 회사든 그렇겠구나 했던 게 되게 컸던 것 같습니다.</span></p><p><span style="background-color: transparent; color: rgb(0, 0, 0);">근데 여기는 좀 그런 술자리 강압이라는 그런 것도 없었고 되게 참여하는 모두가 즐길 수 있는 정말 놀 때는 놀고 일할 때는 일할 때 하는 분위기를 굉장히 대표님부터 시작해서 모든 분들이 열심히 만들어주고 지켜가려고 노력하는 것 같아서 그런 부분이 되게 인상 깊었던 것 같습니다.</span></p><p><br></p><p><strong style="background-color: transparent; color: rgb(0, 0, 0);">Q. 앞으로 어떤 개발자가 되고 싶으신가요?</strong></p><p><span style="background-color: transparent; color: rgb(0, 0, 0);">이 부분에 대해서 요즘 고민을 많이 하고 있긴 한데 사실 명확한 답을 찾지는 못했습니다. 기존에는 이제 프론엔드 쪽으로 그냥 계속 공부를 꾸준히 하고 이 쪽 공부만 하면 그냥 꾸준히 프론트엔드 개발자가 될 수 있겠구나라는 생각이 들었는데 최근 ICT에서 진행했던 교육 중에 저와 같은 프론트엔드를 선택한 학생들이랑 함께 수업을 듣는데 그 분들이 갖고 있던 고민을 얘기하는 시간에 프론트엔드 개발자의 성향이 어느 정도 될 것인지 이후에 AI 대체가 되는 건 또 언제일지 이런 등의 얘기 굉장히 많았습니다. 그런 얘기를 듣다 보니까 프론트엔드로서의 개발자 기간이 많이 남지 않았구나라는 생각이 들었고, 팜피에 왔을 때 데이터 쪽의 설계와 프론트 설계도 했었지만 그 부분과 백엔드 기술도 좀 배우면서 기존에 갖고 있던 프론트엔드 기술 이외의 것을 많이 배우게 됐다고 느끼는데 프론트 뿐만 아니라 풀 스택 개발자로서의 성장을 하면서 프론트엔드 개발자에 국한되지 않는 넓은 분야를 담당할 수 있는 개발자가 되면 좋겠다라는 생각을 요즘 하는 것 같습니다. 정리하면, 풀 스택을 공부하는 개발자가 되면 좋겠다라는 생각을 하고 있습니다.</span></p><p><br></p><p><strong style="background-color: transparent; color: rgb(0, 0, 0);">Q. 고생한 본인에게도 한 마디 해주세요.</strong></p><p><span style="background-color: transparent; color: rgb(67, 67, 67);">사실 9월, 10월, 11월을 지나고 있는데 매 달마다 스스로에게 느꼈던 부분이 되게 달랐습니다. 9월에는 솔직히 자신감이 넘쳤고요.(웃음) 면접 하나 봤는데 붙었다는 자신감이 있었고, 10월에는 열심히 하는 분들을 보면서 ‘나도 저 분들처럼 열심히 해야겠다.’ 인턴분들이나 직원분들 다 열심히 하시는 분들이니까 열심히 하는 분위기 속에서 열심히 하면 참 좋겠다라는 생각이 많이 들었고, 11월이 됐을 때는 ‘내가 열심히 해도 이 분들보다 많이 부족하구나’ 하는 생각과 자신감이 많이 내려갔던 한 달을 보내고 있었습니다. 자신감 부족해져 있는 저 자신한테 얘기를 하자면, 잘하고 있다는 얘기를 해주고 싶습니다. 잘하고 있다. 고생했다. </span></p></div>';
